from sage.all import *
from pwn import *
import json

def solve(n, c):
    c = c * c % n
    P = PolynomialRing(Zmod(n), 'x')
    f = P.gen() * P.gen() - c
    f = f.monic()
    print(f.small_roots(X = 2**128 + 1))
    return str(hex(min(f.small_roots(X = 2**128 + 1))))[2:]

